import React, { useState } from 'react';
import './styles/App.css';
import Header from './components/Header';
import InputSection from './components/InputSection';
import ResultsSection from './components/ResultsSection';
import LoadingSpinner from './components/LoadingSpinner';

function App() {
  const [results, setResults] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleAnalysis = async (analysisData) => {
    setLoading(true);
    setError(null);
    setResults(null);

    try {
      const response = await fetch('/analyze/combined', {
        method: 'POST',
        body: analysisData
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      setResults(data);
    } catch (err) {
      setError(err.message);
      console.error('Analysis error:', err);
    } finally {
      setLoading(false);
    }
  };

  const handleTextAnalysis = async (text, contentType, numRecommendations) => {
    setLoading(true);
    setError(null);
    setResults(null);

    try {
      const response = await fetch('/analyze/text', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          text,
          content_type: contentType,
          num_recommendations: numRecommendations
        })
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      setResults(data);
    } catch (err) {
      setError(err.message);
      console.error('Text analysis error:', err);
    } finally {
      setLoading(false);
    }
  };

  const handleAudioAnalysis = async (audioFile, contentType, numRecommendations) => {
    setLoading(true);
    setError(null);
    setResults(null);

    try {
      const formData = new FormData();
      formData.append('audio_file', audioFile);
      formData.append('content_type', contentType);
      formData.append('num_recommendations', numRecommendations);

      const response = await fetch('/analyze/audio', {
        method: 'POST',
        body: formData
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      setResults(data);
    } catch (err) {
      setError(err.message);
      console.error('Audio analysis error:', err);
    } finally {
      setLoading(false);
    }
  };

  const handleImageAnalysis = async (imageFile, contentType, numRecommendations) => {
    setLoading(true);
    setError(null);
    setResults(null);

    try {
      const formData = new FormData();
      formData.append('image_file', imageFile);
      formData.append('content_type', contentType);
      formData.append('num_recommendations', numRecommendations);

      const response = await fetch('/analyze/image', {
        method: 'POST',
        body: formData
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      setResults(data);
    } catch (err) {
      setError(err.message);
      console.error('Image analysis error:', err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      <Header />
      
      <main className="main-content">
        <div className="container">
          <div className="hero-section">
            <h1 className="hero-title">
              🎬 Multimodal Emotion-Based Movie Recommendation System
            </h1>
            <p className="hero-subtitle">
              Discover your perfect movie or TV show based on your emotions using AI-powered analysis
            </p>
          </div>

          <InputSection 
            onTextAnalysis={handleTextAnalysis}
            onAudioAnalysis={handleAudioAnalysis}
            onImageAnalysis={handleImageAnalysis}
            onCombinedAnalysis={handleAnalysis}
            loading={loading}
          />

          {loading && <LoadingSpinner />}

          {error && (
            <div className="error-message">
              <h3>❌ Error</h3>
              <p>{error}</p>
            </div>
          )}

          {results && <ResultsSection results={results} />}
        </div>
      </main>

      <footer className="footer">
        <p>&copy; 2024 OTT Recommendation System. Powered by Hugging Face AI Models.</p>
      </footer>
    </div>
  );
}

export default App;
